function getZangli(p,extraInfo){
	var d=p;
	if (typeof d == "undefined" || d==""){
		d=new Date();
	}
	if (typeof d == "string"){
		d=new Date(d);
		if("Invalid Date" == d.toString()){
			console.error("错误：\""+p+"\" 字符串的日期格式不对");
			return "error";
		}
	}
	if (typeof d == "number"){
		console.warn("警告：尝试把数字 "+p+" 按秒转换成日期");
		d=new Date(d);
	}

	if(d.constructor != Date){
		console.error("错误：只能接受日期类型数字类型或者标准格式的字符串类型输入,当前输入的是"+ p.constructor.toString());
		return "error";
	}
	d = d.getFullYear()+"/"+(d.getMonth()+1)+"/"+d.getDate();
	var result= zangli[d];
	if(result==undefined){
		console.error("错误：日期"+p+"超出可以转换的范围");
		return "error";			
	}
	if(!!extraInfo){//需要附加的节庆日信息
		if (/月初八$/.test(result)){
			result += "，禅定胜王佛节日，作何善恶成百倍"
		}		
		if (/月初八$/.test(result)){
			result += "，药师佛节日，作何善恶成千倍"
		}		
		if (/月初十$/.test(result)){
			result += "，莲师荟供日，作何善恶成十万倍"
		}		
		if (/月十五$/.test(result)){
			result += "，阿弥陀佛节日，作何善恶成百万倍"
		}		
		if (/月十八$/.test(result)){
			result += "，观音菩萨节日，作何善恶成千万倍"
		}		
		if (/月廿一$/.test(result)){
			result += "，地藏王菩萨节日，作何善恶成亿倍"
		}		
		if (/月廿五$/.test(result)){
			result += "，空行母荟供日"
		}
		if (/月三十$/.test(result)){
			result += "，释迦牟尼佛节日，作何善恶成九亿倍"
		}
		if (/(正月初)|(正月十[一二三四五️])/.test(result)){
			result += "，神变节"
		}
		if (/^四月初七$/.test(result)){
			result += "，释迦牟尼佛诞辰"
		}
		if (/^四月十五$/.test(result)){
			result += "，释迦牟尼佛成道日涅槃日"
		}
		if (/^六月初四$/.test(result)){
			result += "，释迦牟尼佛初转法轮日"
		}
		if (/^六月十五$/.test(result)){
			result += "，释迦牟尼佛入胎日"
		}
		if (/^九月廿二$/.test(result)){
			result += "，释迦牟尼佛天降日"
		}
	}
	return result;
}
if (typeof zangli_callback == "function"){
	zangli_callback();
}

